/**
 * Text decorations ratio of a UILabel
 * Reference: https://docs.microsoft.com/en-us/dotnet/api/xamarin.forms.textdecorations
 */
export class TextDecorations {
    /** @returns {TextDecorations} */ static get NONE(): TextDecorations;
    /** @returns {TextDecorations} */ static get STRIKETHROUGH(): TextDecorations;
    /** @returns {TextDecorations} */ static get UNDERLINE(): TextDecorations;
}
